import React from "react";

import CustomButtonContainer from './custom-button.styles';

// children: text-content
const CustomButton = ({
  children,
  isGoogleSignIn,
  inverted,
  ...otherProps
}) => (
  <CustomButtonContainer 
    {...otherProps}>
    {children}
  </CustomButtonContainer>
);
export default CustomButton;
